import React, { useState, useEffect } from 'react';
import { Card, Button, message, Typography, Space, Alert } from 'antd';
import api from '../services/api';

const { Title, Text } = Typography;

const Debug = () => {
  const [apiStatus, setApiStatus] = useState('检查中...');
  const [authStatus, setAuthStatus] = useState('检查中...');
  const [token, setToken] = useState(null);

  useEffect(() => {
    checkApiStatus();
    checkAuthStatus();
    checkToken();
  }, []);

  const checkApiStatus = async () => {
    try {
      const response = await api.get('/api/auth/');
      console.log('API Status:', response.data);
      setApiStatus('API正常');
    } catch (error) {
      console.error('API Error:', error);
      setApiStatus('API错误: ' + error.message);
    }
  };

  const checkAuthStatus = async () => {
    try {
      const response = await api.get('/api/auth/profile/');
      console.log('Auth Status:', response.data);
      setAuthStatus('已登录');
    } catch (error) {
      console.error('Auth Error:', error);
      setAuthStatus('未登录或认证失败');
    }
  };

  const checkToken = () => {
    const savedToken = localStorage.getItem('token');
    setToken(savedToken);
  };

  const testFilesApi = async () => {
    try {
      const response = await api.get('/api/files/');
      console.log('Files API:', response.data);
      message.success('文件API调用成功');
    } catch (error) {
      console.error('Files API Error:', error);
      message.error('文件API调用失败: ' + error.response?.data?.error || error.message);
    }
  };

  const testSharesApi = async () => {
    try {
      const response = await api.get('/api/files/shares/');
      console.log('Shares API:', response.data);
      message.success('分享API调用成功');
    } catch (error) {
      console.error('Shares API Error:', error);
      message.error('分享API调用失败: ' + error.response?.data?.error || error.message);
    }
  };

  const clearToken = () => {
    localStorage.removeItem('token');
    delete api.defaults.headers.common['Authorization'];
    setToken(null);
    setAuthStatus('未登录');
    message.success('Token已清除');
  };

  return (
    <div style={{ padding: '24px' }}>
      <Title level={2}>系统调试页面</Title>

      <Card style={{ marginBottom: '16px' }}>
        <Title level={4}>系统状态</Title>
        <Space direction="vertical" style={{ width: '100%' }}>
          <div>
            <Text strong>API状态: </Text>
            <Text>{apiStatus}</Text>
          </div>
          <div>
            <Text strong>认证状态: </Text>
            <Text>{authStatus}</Text>
          </div>
          <div>
            <Text strong>Token: </Text>
            <Text code>{token ? `${token.substring(0, 20)}...` : '无'}</Text>
          </div>
        </Space>
      </Card>

      <Card style={{ marginBottom: '16px' }}>
        <Title level={4}>测试功能</Title>
        <Space wrap>
          <Button onClick={testFilesApi}>测试文件API</Button>
          <Button onClick={testSharesApi}>测试分享API</Button>
          <Button onClick={checkApiStatus}>检查API状态</Button>
          <Button onClick={checkAuthStatus}>检查认证状态</Button>
          <Button onClick={clearToken} danger>清除Token</Button>
        </Space>
      </Card>

      {!token && (
        <Alert
          message="未检测到登录Token"
          description="请先登录后再使用文件功能。可以访问 http://localhost:3000/login 进行登录。"
          type="warning"
          showIcon
        />
      )}

      {token && authStatus === '未登录或认证失败' && (
        <Alert
          message="Token可能已过期"
          description="当前Token无效，请重新登录。"
          type="error"
          showIcon
          action={
            <Button size="small" onClick={clearToken}>
              清除Token
            </Button>
          }
        />
      )}
    </div>
  );
};

export default Debug;
